The ‚Äúyappers.‚Äù
The ‚Äúdemon rats.‚Äù
The ‚Äúankle biters.‚Äù

I‚Äôve heard dog owners scoff at little dogs (especially chihuahuas) and write them off as sub-canine: psychotic, annoying, and unstable. They‚Äôll attribute these characteristics to small dogs as if they are defining breed traits. But it‚Äôs that exact attitude that perpetuates the real issue.

People don‚Äôt hold the same expectations for little dogs as they do for large dogs. It‚Äôs humans‚Äô lack of a high enough standard that has earned these little guys a bad rep.

If you don‚Äôt actively work with your dog, you will start to see deviant and inappropriate behavior from him. Unfortunately, many owners of small dogs don‚Äôt provide any balance or structure in their pup‚Äôs life. Because the dog is so small, people figure that it‚Äôs easy enough to just pick up the dog or manhandle the dog rather than train him. You open the front door? See another dog on the walk? Have guests over? Just pick up the dog.

This leads to an unbalanced canine who is ill-equipped to make good decisions and unable to properly communicate with their owners. The little dog acts out, the owner shrugs their shoulders saying ‚Äúthat‚Äôs how he is,‚Äù and the cycle perpetuates.

But owners like Scout‚Äôs break that cycle and stigma. They expect their chi mix to behave appropriately and communicate effectively. They expect him to not terrorize guests or act out inappropriately. They expect Scout to live a fulfilled, balanced, and mentally healthy life. They expect him to act like an awesome dog.

And now, he does

because they have the means by which to communicate that expectation to him.

Communication + Expectations = Positive Relationship Regeneration.
